#include <stdio.h>
int main(){int w;if(scanf("%d",&w)!=1)return 0;switch(w){case 1:printf("Monday");break;case 2:printf("Tuesday");break;case 3:printf("Wednesday");break;case 4:printf("Thursday");break;case 5:printf("Friday");break;case 6:printf("Saturday");break;case 7:printf("Sunday");break;default:printf("Invalid");}return 0;}
